const dialogStyle = {
    height: '96%',
    marginTop: '12%',
    width:'60%',
    maxWidth: '100%',
    boxShadow: 'none',
    overflow: 'none'

}

const LoginDialog = () =>
{
    return(
        <Dialog
        open = {true}
        PaperProps = {{sx:dialogStyle}}>
        
            <Box>
                <Box>
                        typography
                </Box>
                <Box>

                </Box>

            </Box>
        </Dialog>
    )
}

export default LoginDialog;
